import React from 'react';
import { Article } from './articleRegDrop';
import { Workshop } from './workshopRegDrop';
import { ModalPrototype } from '../../modal'

export const ModalArt = ({ handleClose, show, registration }) => {
    return (
        <ModalPrototype show={show} handleClose={handleClose}
            children={<Article registration={registration} />} />
    );
}

export const ModalWork = ({ handleClose, show, registration }) => {
    return (
        <ModalPrototype show={show} handleClose={handleClose}
            children={<Workshop registration={registration} />} />
    );
}
